import React from 'react';
import {NavLink} from 'react-router-dom';
const Menu=()=>{
    return(<>
            <NavLink className='navLink' exact activeClassName='active_class' to='/'>aboutUs</NavLink>
            <NavLink className='navLink' exact activeClassName='active_class' to='/contact'>contact </NavLink>
            <NavLink className='navLink' exact activeClassName='active_class' to='/user'>user </NavLink>
            <NavLink className='navLink' exact activeClassName='active_class' to='/user'>user </NavLink>
            <br />
            {/* <a href='/'>aboutus</a>
            <a href='/contact'>contact</a> */}


            </>)
}
export default Menu;
